description:
PC*MILER|Streets is street-level routing, mileage and mapping software designed to provide dock-to-dock driving directions over truck-specific routes. It includes all the features and functionality of PC*MILER with an enhanced U.S. and Canadian street-level routing network, map database, and street address database. Ensure that your vehicles and loads get to the right place using the most precise truck-specific route possible, taking into consideration truck-designated, truck-preferred and truck-restricted roads.

